const UnitDropdown = [
    { id: 'NONE', name: 'None' },
    { id: 'GM', name: 'gm' },
    // { id: 'KG', name: 'kg' },
    // { id: 'L', name: 'liter' },
    { id: 'ML', name: 'ml' },
    { id: 'TSP', name: 'tsp' },
    { id: 'TBSP', name: 'tbsp' },
]
export default UnitDropdown;
